import ExpenseItem from "../../02-molecules/ExpenseItem/ExpenseItem";
import AddButton from "../../01-atoms/buttons/add-button/AddButton";

function ExpenseItemsList() {
  const expensesDummyData = [
    { id: 'e1', title: 'Zakupy spożywcze', money: '378', date: new Date(2023, 5, 19),},
    { id: 'e2', title: 'Paliwo', money: '242', date: new Date(2023, 5, 1),},
    { id: 'e3', title: 'Jedzenie dla kota', money: '79', date: new Date(2023, 5, 11),},
    { id: 'e4', title: 'Nowy telefon', money: '1200', date: new Date(2023, 3, 12),},
  ]
  return (
    <section className="expenses-container">
      <header className="expenses-header">
        <h2 className="expenses-header--title">My Expenses</h2>
        <AddButton>Add New Expense</AddButton>
      </header>
      <ExpenseItem title={expensesDummyData[0].title} money={expensesDummyData[0].money} date={expensesDummyData[0].date}/>
      <ExpenseItem title={expensesDummyData[1].title} money={expensesDummyData[1].money} date={expensesDummyData[0].date}/>
      <ExpenseItem title={expensesDummyData[2].title} money={expensesDummyData[0].money} date={expensesDummyData[0].date}/>
      <ExpenseItem title={expensesDummyData[3].title} money={expensesDummyData[0].money} date={expensesDummyData[0].date}/>
    </section>
  );
}
export default ExpenseItemsList;
